import unittest

from rotation_of_another_string import rotation_of_another_string

class TestCases(unittest.TestCase):
    def test_rotation_of_another_string(self):
        self.assertEqual(rotation_of_another_string("wwopdsrawspxsxqtwfgfqhaeoqzbuufmfjymmyuscaiscmjw", "jwwwopdsrawspxsxqtwfgfqhaeoqzbuufmfjymmyuscaiscm"), True)
        self.assertEqual(rotation_of_another_string("Cattywampus", "sCattywampu"), True)
        self.assertEqual(rotation_of_another_string("", ""), True)
        self.assertEqual(rotation_of_another_string("Widdershins", "ddershinsWi"), True)

if __name__ == "__main__":
    unittest.main(verbosity=2)